import logo from './logo.svg';
import './App.css';
import NavBar from './NavBar.js'
import Carousel from './carousel.js'
import Card from './Card'
function App() {
  return (
    <div className="App">
     <NavBar/>
     <Carousel></Carousel>
     <Card Image="flag.png"></Card>
     <Card Image="india.png"></Card>
     <Card Image="spain.png"></Card>

    </div>
  );
}

export default App;
